}
a{
    text-decoration: none;
    color:#433D86;
}
a:hover{
    color:#376b3d;
}
main {
    padding: 5vw;
}
.mybutton{
  background-color: #C0BBFF;
  padding:5px;
  border-radius: 10%;
  margin-top: 10px;
  cursor:pointer ;

}
cite{
    font-weight: 800;
}
h1 {
    font-family: frijole;
    font-size: 7vw;
}
blockquote{
    font-size: 20px;
    font-style: italic;
    color:#7e7d7d;
}
blockquote a {
    margin-left: 15px;
    font-weight: 400;

}
#next{
    position: relative;
    float:right;
    bottom: 46px;
    right:10px;
    font-weight: 800;

}
#previous{
    font-weight: 800;
    margin: 10px;
}


/* general table setting */

table{
    border-collapse:collapse;
    margin:auto;
}
td,th{
    padding:5px;
    border:1px solid #000;
}
table caption{
    color:#433D86;
    background-color:#C0BBFF;
    border: 1px solid #433D86;
}

/* Iframe video setting */
iframe{
    width: 80vw;
    height:50vw;
    max-height: 600px;
}


/* header */

nav p {
    color:#f4f3f1;
    margin:auto;
    font-size:4vw;
}
nav h1 {
    color:#C0BBFF;
    margin:auto;
    font-size: 5vw;
}
#nav-options {
    background-color: #f4f3f1;
    text-align: center;
}
#nav-options ul{
    font-size: 4vw;
    list-style: none; 
    border-bottom:1px solid #000;
}
#nav-options ul li {
    margin: 3vw auto;
}

#nav-options ul li a {
    color:#433D86;
    font-weight:800;
}
#nav-options ul li a:hover{
    color:#376b3d;

}
#nav-options .here{
    color:#376b3d;
    cursor:default;
}
#title{
    padding:3vw;
    background-color:#000;
}

#title img{
    width: 200px;
    padding:0;
    margin:-70px auto -80px auto;
}

/* images: */
img{
    width: 80vw;
}

figure {
    margin:0;
    text-align: center;
}
figure {
    margin:20px;
    text-align: center;
    display:grid;
}

figure span{
    margin:5px;
    font-size:15px;
    line-height: 15px;
}


/* animations*/
.image-circle{
    border-radius: 50%;
    height: 300px;
    width: 300px;
    margin: auto;
    background-image:url(./nfb1_sm.jpg);
    background-size:cover;
    background-position:expanded;
    background-repeat:no-repeat;
    animation-name: imageChanging;
    overflow:visible;
    animation-duration:30s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;

}

#nonFictionShow{
    height: 300px;
    width: 300px;
    margin: auto;
    background-image:url(./nfb1_sm.jpg);
    background-size:cover;
    background-position:expanded;
    background-repeat:no-repeat;
    animation-name: nonFictionChanging;
    animation-duration:15s;
    overflow:visible;

    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
}
#FictionShow{
    height: 300px;
    width: 350px;
    margin: auto;
    background-image:url(./fb_01_sm.jpg);
    background-size:center;
    background-position:center;
    background-repeat:no-repeat;
    animation-name: fictionChanging;
    overflow:visible;
    animation-duration:60s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
}

#bookDisplay figure a img:hover{
    border:10px solid #C0BBFF;
    animation: shake 0.5s;
    animation-iteration-count:infinite;
}


@keyframes shake {
    0% { transform: translate(1px, 1px) rotate(0deg); }
    10% { transform: translate(-1px, -2px) rotate(-1deg); }
    20% { transform: translate(-3px, 0px) rotate(1deg); }
    30% { transform: translate(3px, 2px) rotate(0deg); }
    40% { transform: translate(1px, -1px) rotate(1deg); }
    50% { transform: translate(-1px, 2px) rotate(-1deg); }
    60% { transform: translate(-3px, 1px) rotate(0deg); }
    70% { transform: translate(3px, 1px) rotate(-1deg); }
    80% { transform: translate(-1px, -1px) rotate(1deg); }
    90% { transform: translate(1px, 2px) rotate(0deg); }
    100% { transform: translate(1px, -2px) rotate(-1deg); }
